"use strict";(self.webpackChunkmy_blog=self.webpackChunkmy_blog||[]).push([[1477],{10:t=>{t.exports=JSON.parse('{"blogPosts":[{"id":"/review/computer-structure-and-OS-to-study-alone","metadata":{"permalink":"/blog/review/computer-structure-and-OS-to-study-alone","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/review/computer-structure-and-OS-to-study-alone.md","source":"@site/blog/review/computer-structure-and-OS-to-study-alone.md","title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","description":"\ud63c\uacf5 \uc2dc\ub9ac\uc988","date":"2022-09-11T00:00:00.000Z","formattedDate":"2022\ub144 9\uc6d4 11\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":false,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\ub294 \uac83\uc774 \uc88b\uc740 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","date":"2022-09-11","authors":"teddygood","tags":["Book Review"],"draft":false,"description":"\ud63c\uacf5 \uc2dc\ub9ac\uc988","keywords":["\ucef4\ud4e8\ud130\uad6c\uc870","\uc6b4\uc601\uccb4\uc81c","\ud63c\uacf5"],"sidebar_position":1},"nextItem":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","permalink":"/blog/review/Git-GitHub-introduction"}},"content":"**<center>\ud55c\ube5b\ubbf8\ub514\uc5b4 <\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4> \ud65c\ub3d9\uc744 \uc704\ud574\uc11c \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ub41c \uc11c\ud3c9\uc785\ub2c8\ub2e4.</center>**\\n\\n![\ub098\ub294 \ub9ac\ubdf0\uc5b4\ub2e4 2022](../assets/I-am-reviewer-2022.jpg)\\n\\n## Book Info\\n\\n**<center>`\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!`</center>**\\n\\n[![\ucc45](../assets/review/computer-structure-and-OS-to-study-alone.jpg)](https://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791162243091&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c\\n- \uc800\uc790: \uac15\ubbfc\ucca0\\n- \ucd9c\ud310\uc0ac: \ud55c\ube5b\ubbf8\ub514\uc5b4\\n- \ucd9c\uac04: 2022-08-16\\n\\n## Intro\\n\\n\ubc8c\uc368 \ub124 \ubc88\uc9f8 \uc77d\uc5b4\ubcf4\ub294 \ud63c\uacf5 \uc2dc\ub9ac\uc988 \ucc45\uc785\ub2c8\ub2e4. \uc774\ubc88\uc5d0\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c\ub97c \uc8fc\uc81c\ub85c \ub098\uc654\ub124\uc694. \uc800\ub294 \uc194\uc9c1\ud788 \ud63c\uacf5 \uc2dc\ub9ac\uc988\uac00 \ub108\ubb34 \uc27d\ub2e4\ub294 \uc774\uc720\ub85c \ubcc4\ub85c \uc88b\uc544\ud558\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uc804\uacf5\uc790 \uc785\uc7a5\uc5d0\uc11c\ub294 \ub354 \uc138\ubd80\uc801\uc778 \uac78 \uc6d0\ud558\uac8c \ub418\ub294 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uba87\uba87 \ub2e4\uc591\ud55c \ucc45\uc744 \uc77d\uc5b4\ubcf4\ub2c8 \ud63c\uacf5 \uc2dc\ub9ac\uc988\ub9cc\ud07c \uc77d\uae30 \ud3b8\ud55c \ucc45\uc774 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\uc81c\ub294 \ube44\uc804\uacf5\uc790 \ub610\ub294 \ub9c9 \uacf5\ubd80\ud558\uae30 \uc2dc\uc791\ud558\ub294 \uc804\uacf5\uc0dd\uc5d0\uac8c \ub108\ubb34 \ub3c4\uc6c0\uc774 \ub418\ub294 \uc2dc\ub9ac\uc988\ub77c\uace0 \ub290\ub07c\uace0 \uc788\uc2b5\ub2c8\ub2e4.\\n\\n## Book Review\\n\\n### \uc77d\uae30 \uc26c\uc6b4 \ucc45\\n\\n\ucef4\ud4e8\ud130 \uad6c\uc870\ub97c \ucc98\uc74c \uacf5\ubd80\ud558\uac8c \ub418\uba74 architecture\ub97c ARM \ub610\ub294 RISC-V\ub85c \ubc30\uc6b0\uac8c \ub418\ub294\ub370 \uc774 \ucc45\uc740 \uc785\ubb38\uc790\ub97c \ub300\uc0c1\uc73c\ub85c \ud558\ub2c8 \uadf8\ub7f0 \uc5b4\ub824\uc6b4 \uc9c0\uc2dd\uc740 \uac70\uc758 \ubc30\uc81c\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ub108\ubb34 \ub514\ud14c\uc77c\ud558\uac8c CS \uc9c0\uc2dd\uc744 \uc54c\ub824\uc8fc\ub294 \ucc45\uc740 \uc544\ub2c8\ub77c\ub294 \uac81\ub2c8\ub2e4. \ub9cc\uc57d \uc774 \ucc45\uc774 \ub514\ud14c\uc77c\ud558\uace0 \uc27d\uac8c \uc124\uba85\ub418\uc5c8\ub354\ub77c\uba74 \ucc45 \ub450\uaed8\uac00 \uc5b4\ub9c8\uc5b4\ub9c8\ud588\uc744 \uac83\uc785\ub2c8\ub2e4.\\n\\n\uc815\ub9d0 \uaf2d \ud544\uc694\ud55c \ud544\uc218 \uc694\uc18c \uc989, \ud575\uc2ec\ub9cc \ub4e4\uc5b4\uac00 \uc788\uc73c\uba70 \uacf5\ubd80\ud558\uba74\uc11c \uc4f8\ub370\uc5c6\ub294 \uace0\ubbfc\uc744 \ud558\uc9c0 \uc54a\uac8c \ud574\uc90d\ub2c8\ub2e4. \uadf8\ub7f0 \uc810\uc5d0\uc11c \uc800\ub294 \uc774 \ucc45\uc774 \ub9e4\uc6b0 \uc77d\uae30 \uc26c\uc6e0\ub2e4\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n### \uc774\ud574\ud558\uae30 \uc26c\uc6b4 \uadf8\ub9bc\\n\\n\ucd08\ubcf4\uc790\uac00 \uc774\ud574\ud558\uae30 \uc27d\ub3c4\ub85d \uadf8\ub9bc\uc73c\ub85c \ub9e4\uc6b0 \uc124\uba85\uc774 \uc798 \ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ucef4\ud4e8\ud130 \uad6c\uc870 \uac19\uc740 \uacbd\uc6b0\uc5d0\ub294 \ucc98\uc74c \uacf5\ubd80\ud558\uac8c \ub418\uba74 \uc5b4\ub5a4 \uad6c\uc870\ub85c \ub3cc\uc544\uac00\ub294\uc9c0 \uc21c\uc11c\uac00 \uc5b4\ub824\uc6b8 \uc218 \uc788\uc73c\ub098 \uc774 \ucc45\uc740 \uccab \uc7a5\ubd80\ud130 \uc0bd\ud654\ub85c \uc798 \ud45c\ud604\uc774 \ub418\uc5b4 \uc788\uae30\uc5d0 \uc5b4\ub835\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4.\\n\\n### \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud55c \ucc45\\n\\n\ud63c\uc790 \uacf5\ubd80\ud558\uac8c \ub418\uba74 \uc790\uc2e0\uc774 \uacf5\ubd80\ud55c \uc9c0\uc2dd\uc774 \uc81c\ub300\ub85c \uba38\ub9ac\uc5d0 \ub0a8\uc558\ub294\uc9c0 \uc54c\uae30 \uc27d\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \uacf5\ubd80\ud55c \ud6c4\uc5d0 \uc9c0\uc2dd\uc744 \uc810\uac80\ud558\ub294 \uac83\uc740 \uaf2d \ud544\uc218\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uac01 \uc7a5\uc758 \ub9c8\uc9c0\ub9c9\uc5d0 \ub9c8\ubb34\ub9ac\ub85c \uc815\ub9ac\ub97c \ub2e4\uc2dc \ud574\uc8fc\uace0, \ud655\uc778 \ubb38\uc81c\ub97c \ud1b5\ud574 \uc81c\ub300\ub85c \uacf5\ubd80\ud588\ub294\uc9c0 \uc810\uac80\ud560 \uc218 \uc788\uac8c \ud574\uc90d\ub2c8\ub2e4. \uc774\uac8c \ud63c\uacf5 \uc2dc\ub9ac\uc988\uc758 \uc7a5\uc810\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n\ucc45\uc758 \ub9e8 \ub05d\uc5d0 \ubd80\ub85d\uc73c\ub85c \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud55c \ud63c\uacf5 \uc6a9\uc5b4 \ub178\ud2b8\uac00 \uc788\uc2b5\ub2c8\ub2e4. \uc815\ub9d0 \ubcc4\uac70 \uc544\ub2c8\uc9c0\ub9cc, \uc815\ub9d0 \ucd9c\ud310\uc0ac\uac00 \ud63c\uc790 \uacf5\ubd80\ud558\ub294 \uc0ac\ub78c\uc744 \uc704\ud574 \ub178\ub825\ud558\uace0 \uc788\ub2e4\ub294 \ubaa8\uc2b5\uc774 \ubcf4\uc5ec\uc11c \uc7ac\ubc0c\uae30\ub3c4 \ud558\uace0, \uc774 \ucc45\uc744 \uc77d\ub294 \uc0ac\ub78c\uc5d0\uac8c\ub294 \ub3c4\uc6c0\uc774 \ub9ce\uc774 \ub418\uaca0\ub2e4\uace0 \uc0dd\uac01\ud588\uc2b5\ub2c8\ub2e4.\\n\\n## \ub300\uc0c1 \ub3c5\uc790\\n\\n\ucef4\ud4e8\ud130 \uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c \uc218\uc5c5\uc744 \uc120\ud589 \ud559\uc2b5\ud574\ubcf4\uace0 \uc2f6\uc740 2\ud559\ub144 \uc804\uacf5\uc0dd\uc5d0\uac8c \ucd94\ucc9c\ud569\ub2c8\ub2e4. \uc81c\uac00 \ucef4\ud4e8\ud130\uad6c\uc870, \uc6b4\uc601\uccb4\uc81c \uc218\uc5c5\uc744 \ub4e4\uc744 \ub54c \uc774 \ucc45\uc774 \uc65c \uc5c6\uc5c8\ub294\uc9c0 \uc544\uc27d\uae30\ub9cc \ud569\ub2c8\ub2e4. \uadf8\ub54c\ub85c \ub3cc\uc544\uac04\ub2e4\uba74 \uc218\uc5c5\ubcf4\ub2e4 \uc774 \ucc45\uc73c\ub85c \uba3c\uc800 \uacf5\ubd80\ub97c \uc2dc\uc791\ud588\uc744 \uac83\uc785\ub2c8\ub2e4.\\n\\n\ub610\ud55c, \uc694\uc998 \ub9ce\uc740 \ube44\uc804\uacf5\uc790\ub4e4\uc774 \uad6d\ube44 \ud559\uc6d0 \ub610\ub294 \ub2e4\uc591\ud55c \uad50\uc721 \ud504\ub85c\uadf8\ub7a8\uc744 \ud1b5\ud574 \uac1c\ubc1c\uc744 \uacf5\ubd80\ud558\uace0 \uc788\ub294 \uac78\ub85c \uc54c\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub7ec\ub098 \uadf8\ub7f0 \ud504\ub85c\uadf8\ub7a8\uc5d0\uc11c\ub294 CS \uacf5\ubd80\ub97c \uc815\ub9d0 \uac04\ub2e8\ud558\uac8c \ud558\ub294 \uacbd\uc6b0\uac00 \ub9ce\uc740 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \uc194\uc9c1\ud788 \uc800\ub294 \uadf8 \uc815\ub3c4\uc758 \uacf5\ubd80\ub85c\ub294 \ubd80\uc871\ud558\ub2e4\uace0 \uc0dd\uac01\ud558\ub294 \uc0ac\ub78c\uc73c\ub85c\uc11c \ud504\ub85c\uadf8\ub7a8\uc758 \uc218\uc5c5\uc744 \ub4e3\ub418, \uaf2d \ucc45\ub3c4 \uc77d\uc5b4\ubcf4\ub77c\uace0 \uad8c\ud569\ub2c8\ub2e4. \ub098\uc911\uc5d0 \ub2e4\uc2dc \ucc45 \ucd94\ucc9c\ud560 \uc77c\uc774 \uc788\ub354\ub77c\uba74 \uc774 \ucc45\uc73c\ub85c \ucef4\ud4e8\ud130\uad6c\uc870\uc640 \uc6b4\uc601\uccb4\uc81c\ub97c \uacf5\ubd80\ud574\ubcf4\ub77c\uace0 \ud560 \uac83 \uac19\uc2b5\ub2c8\ub2e4."},{"id":"/review/Git-GitHub-introduction","metadata":{"permalink":"/blog/review/Git-GitHub-introduction","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/review/Git-GitHub-introduction.md","source":"@site/blog/review/Git-GitHub-introduction.md","title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","description":"Must Have | \ud504\ub85c\uc81d\ud2b8 \ud611\uc5c5 \uc2dc\ub098\ub9ac\uc624\ub85c \uc775\ud788\ub294 Git&GitHub \ubc18\ubcf5 \ud559\uc2b5\uc11c","date":"2021-10-08T00:00:00.000Z","formattedDate":"2021\ub144 10\uc6d4 8\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":false,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\ub294 \uac83\uc774 \uc88b\uc740 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","date":"2021-10-08","authors":"teddygood","tags":["Book Review"],"draft":false,"description":"Must Have | \ud504\ub85c\uc81d\ud2b8 \ud611\uc5c5 \uc2dc\ub098\ub9ac\uc624\ub85c \uc775\ud788\ub294 Git&GitHub \ubc18\ubcf5 \ud559\uc2b5\uc11c","keywords":["Git","GitHub"],"sidebar_position":1},"prevItem":{"title":"\ud63c\uc790 \uacf5\ubd80\ud558\ub294 \ucef4\ud4e8\ud130 \uad6c\uc870+\uc6b4\uc601\uccb4\uc81c","permalink":"/blog/review/computer-structure-and-OS-to-study-alone"},"nextItem":{"title":"\uc5b4\ub5a4 \uc8fd\uc74c\uc774 \uc0b6\uc5d0\uac8c \ub9d0\ud588\ub2e4","permalink":"/blog/review/some-death-told-life"}},"content":"**<center>\uace8\ub4e0\ub798\ube57 \ucd9c\ud310\uc0ac\ub85c\ubd80\ud130 \ucc45\uc744 \uc81c\uacf5\ubc1b\uc544 \uc791\uc131\ud588\uc2b5\ub2c8\ub2e4.</center>**\\n\\n## Book Info\\n\\n**<center>`\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!`</center>**\\n\\n[![\ucc45](../assets/review/Git-GitHub-introduction.jpg)](http://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9791191905014&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38\\n- \uc800\uc790: \ubc15\ubbf8\uc815\\n- \ucd9c\ud310\uc0ac: \uace8\ub4e0\ub798\ube57\\n- \ucd9c\uac04: 2021-09-13\\n\\n## Intro\\n\\n\uc774 \ucc45\uc740 \ubc15\ubbf8\uc815\ub2d8\uc774 \uc4f0\uc2e0 \ucc45\uc785\ub2c8\ub2e4. \uc804 \uc774 \uc800\uc790\ubd84\uc744 \uc608\uc804\uc5d0 \ud398\uc774\uc2a4\ubd81 `\uc5bc\ub610` \uadf8\ub8f9\uc5d0\uc11c \uc54c\uac8c \ub410\uc2b5\ub2c8\ub2e4. \uc774 \uadf8\ub8f9\uc740 \uc81c\uac00 \uad00\uc2ec \uc788\ub294 \uac1c\ubc1c \uadf8\ub8f9\uc5d0 \ub4e4\uc5b4\uac00\ub2e4\uac00 \uc54c\uac8c \ub41c \uadf8\ub8f9\uc785\ub2c8\ub2e4. \\"\uc5bc\ub610\\"\ub77c\uace0 \ud558\uba74 \ubb34\uc2a8 \uadf8\ub8f9\uc778\uc9c0 \uc798 \ubaa8\ub974\uc2e4 \uac70 \uac19\uc544\uc11c \ubd80\uc5f0\uc124\uba85\uc744 \ud558\uc790\uba74 `Early \ub610\ub77c\uc774`\uc758 \uc904\uc784\ub9d0\ub85c\uc368 `\uc77c\ucc0d \uc77c\uc5b4\ub098\ub294 \ub610\ub77c\uc774\uac00 \uc138\uc0c1\uc744 \ubc14\uafbc\ub2e4.`\ub77c\ub294 \uc8fc\uc81c\ub85c \uc6b4\uc601\ub418\ub294 \uadf8\ub8f9\uc785\ub2c8\ub2e4. \uadf8\ub8f9\uc5d0 \ub300\ud55c \ub354 \uc790\uc138\ud55c \uc815\ubcf4\ub294 \ud398\uc774\uc2a4\ubd81\uc5d0 \uac80\uc0c9\ud574\ubcf4\uc2dc\ub294 \uac78 \ucd94\ucc9c\ud574 \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n\uc5b4\uca0c\ub4e0 \uc774 \uadf8\ub8f9\uc758 \ucde8\uc9c0\ub3c4 \uc7ac\ubc0c\uc5b4 \ubcf4\uc774\uace0 \ud558\ub8e8\ub97c \uc2dc\uc791\ud558\uae30 \uc88b\ub2e4\uace0 \uc0dd\uac01\ud558\uc5ec \uc544\uce68\ub9c8\ub2e4 \uc774 \uadf8\ub8f9\uc758 \uae00\uc744 \ubd24\uc2b5\ub2c8\ub2e4. \uc804 \uadf8\ub8f9 \ucc38\uc5ec\ub294 \uc790\uc8fc \ud558\uc9c0 \uc54a\uc558\uc9c0\ub9cc, \ub9e4\ubc88 \uc544\uce68\uc5d0 \uc0ac\ub78c\ub4e4\uc774 \uc5b4\ub5bb\uac8c \uc0ac\ub294\uc9c0 \uc9c0\ucf1c\ubcf4\uace0 \ub3d9\uae30\ubd80\uc5ec\ub97c \ubc1b\uc73c\uba70 \ud558\ub8e8\ub97c \uc77c\ucc0d \uc2dc\uc791\ud560 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ud558\ub8e8\ub97c \uc77c\ucc0d \uc2dc\uc791\ud574\ubcf4\uace0 \uc2f6\uc740 \ubd84\uc774\ub77c\uba74 \uc774 \uadf8\ub8f9\uc5d0 \uac00\uc785\ud558\uc154\uc11c \ud65c\ub3d9\ud574\ubcf4\uc2dc\ub294 \uac83\ub3c4 \uc7ac\ubc0c\uc744 \uac83\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n\uc774\ub7f0 \uadf8\ub8f9\uc744 \uc6b4\uc601\ud558\uc2dc\ub294 \uc791\uac00\ub2d8\uc758 SNS\ub9cc \ubcf4\uba74 \uc815\ub9d0 \ubc14\uc058\uace0 \uc5f4\uc2ec\ud788 \uc0ac\uc2e0\ub2e4\ub294 \uac83\uc744 \ub290\ub084 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc815\ub9d0 \ud32c\uc774\uc5b4\uc11c \uba87 \ub2ec \uc804 \ubca0\ud0c0\ub9ac\ub354\ub3c4 \uc2e0\uccad\ud588\uc5c8\ub294\ub370 \uc548\ud0c0\uae5d\uac8c \ub5a8\uc5b4\uc84c\uc2b5\ub2c8\ub2e4\ub9cc, \uc774\ubc88\uc5d0 \uc88b\uc740 \uae30\ud68c\ub85c \ucc45\uc744 \uc9c0\uc6d0\ubc1b\uc544 \uc77d\uc5b4\ubcfc \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\\n## \ucc45 \ub9ac\ubdf0\\n\\n### \uc2dc\ub098\ub9ac\uc624\\n\\n\uc774 \ucc45\uc5d0\ub294 `\uc2dc\ub098\ub9ac\uc624`\ub77c\uace0 \ub2e4\ub978 \ucc45\uacfc \uad6c\ubcc4\ub418\ub294 \uc7ac\ubc0c\ub294 \ubd80\ubd84\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \ubd80\ubd84\uc740 \uc774\uc804\uc5d0 \ubc30\uc6b4 \ub0b4\uc6a9\uc744 \uc5b4\ub5a4 \ud55c \uc2dc\ub098\ub9ac\uc624\uc5d0 \ub300\uc785\ud558\uc5ec \ud604\uc5c5\uc5d0\uc11c \uc9c4\ud589\ub418\ub294 \ud504\ub85c\uc81d\ud2b8 \ud504\ub85c\uc138\uc2a4\ub97c \uadf8\ub300\ub85c \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\ub294 \ubd80\ubd84\uc785\ub2c8\ub2e4. \uba87 \ubc88\uc758 \ud480 \ub9ac\ud018\uc2a4\ud2b8\ub97c \ud574\ubd24\uc9c0\ub9cc `\uc2e4\uc81c \ud604\uc5c5\uc5d0\uc11c\ub294 \uc5b4\ub5a4 \uacfc\uc815\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c8\uae4c?`\ub77c\ub294 \uace0\ubbfc\uc744 \ud588\ub358 \uc801\uc774 \uc788\uc2b5\ub2c8\ub2e4. \ub300\ub7b5 \uc5b4\ub5a4 \uacfc\uc815\uc73c\ub85c \uc774\ub8e8\uc5b4\uc9c0\ub294\uc9c0 \uc608\uc0c1\ub9cc \ud588\uc5c8\uc9c0\ub9cc, \uc774 \ucc45\uc744 \ud1b5\ud574\uc11c \ud504\ub85c\uc138\uc2a4\ub97c \uc9c1\uc811 \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\uc5b4\uc11c \uc0c1\ub2f9\ud788 \ub3c4\uc6c0\uc774 \ub410\uc2b5\ub2c8\ub2e4. \\n\\n\\n### \ubc30\ud3ec \ubc0f \uc790\ub3d9\ud654 \\n\\n\ub2e4\ub978 \ucc45 \ub610\ub294 \uac15\uc758\uc5d0\uc11c\ub294 Git, GitHub \uc2e4\uc2b5\uc744 HTML, CSS, JavaScript \uac19\uc740 \uac04\ub2e8\ud55c \uc5b8\uc5b4\ub4e4\ub85c \uc9c4\ud589\ud588\uc744 \ud150\ub370 \uc774 \ucc45\uc5d0\uc11c\ub294 Node.js \uae30\ubc18\uc73c\ub85c \uc9c4\ud589\ud569\ub2c8\ub2e4. \uadf8 \uc774\uc720\ub294 `GitHub Action`\uc744 \uc0ac\uc6a9\ud574\ubcf4\uae30 \uc704\ud568\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ub3c4\uad6c\ub97c \uc0ac\uc6a9\ud558\uc5ec \uc790\ub3d9\ud654\ud558\uace0 \ubc30\ud3ec\ud558\ub294 \ub0b4\uc6a9\uc774 \uc778\uc0c1\uc801\uc774\uc5c8\uc2b5\ub2c8\ub2e4. GitHub Action\uae4c\uc9c0 \uc54c\ub824 \uc8fc\ub294 \ucc45\uc740 \uba87 \uc5c6\uae30\uc5d0 GitHub Action\uc744 \uacbd\ud5d8\ud574\ubcf4\uace0 \uc2f6\uc740 \ubd84\uc774\ub77c\uba74 \uc774 \ucc45\uc744 \uc77d\ub294 \uac83\uc774 \ub3c4\uc6c0\uc774 \ub420 \uac83\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n### VSCode\\n\\n\uc608\uc804\uc5d0 \uc804 \uae43 \uba85\ub839\uc5b4\ub97c \uc9c1\uc811 \uc785\ub825\ud558\uace0 \uc2e4\ud589\ud558\ub294 \uac83\uc774 \ub108\ubb34 \ubc88\uac70\ub86d\ub2e4\uace0 \uc5ec\uaca8 \uc880 \ub354 \ud3b8\ud55c \ubc29\ubc95\uc744 \ucc3e\uc558\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8 \ubc29\ubc95\uc774 \ubc14\ub85c VSCode\uc5d0\uc11c \uae43\uc744 \uc0ac\uc6a9\ud558\ub294 \uac83\uc785\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uae43 \uba85\ub839\uc5b4\ub97c \uc9c1\uc811 \uc2e4\ud589\ud558\uace0 \ubc18\ubcf5\ud558\uba70 \uae43\uc5d0 \uc775\uc219\ud574\uc9c0\ub294 \uac83\uc5d0 \ucd08\uc810\uc744 \ub9de\ucd94\uace0 \uc788\uc9c0\ub9cc, \uba85\ub839\uc5b4\uc5d0 \ub108\ubb34 \uc775\uc219\ud55c \ubd84\ub4e4\uc774\ub77c\uba74 VSCode\ub97c \uc0ac\uc6a9\ud574\ubcf4\ub294 \uac83\ub3c4 \ud3b8\ub9ac\ud55c \ubc29\ubc95\uc774 \ub420 \uc218 \uc788\uc744 \uac83\uc785\ub2c8\ub2e4. \uc774 \ucc45\uc5d0\uc11c\ub294 \ubd80\ub85d\uc73c\ub85c VSCode\ub97c \uc0ac\uc6a9\ud574\ubcf4\ub294 \ubc29\ubc95\uc744 \uc54c\ub824\uc90d\ub2c8\ub2e4.\\n\\n\\n### \uc704\ucca8\uc790 \uc6d0\uc5b4 \uc124\uba85\\n\\n\uc804 \uc704\ucca8\uc790\ub85c \uc804\ubb38 \uc6a9\uc5b4\ub97c \uc6d0\ubb38(\uc601\uc5b4) \uadf8\ub300\ub85c \uc801\uc5b4\ub0b4\ub294 \ubaa8\uc2b5\ub4e4\uc774 \uc88b\uc558\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \ubd80\ubd84\uc740 \ubcf4\ud1b5 \ubcc0\uc5ed\uc11c\uc5d0\uc11c \ucd9c\ud310\uc0ac \ub610\ub294 \uc5ed\uc790\uaed8\uc11c \ub3c5\uc790\ub4e4\uc774 \uc77d\uae30 \ub354 \ud3b8\ud558\ub3c4\ub85d \ud45c\uae30\ud558\ub294 \ubd80\ubd84\uc774\ub77c\uace0 \uc54c\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ud55c\uad6d \ub3c4\uc11c\uc5d0\uc11c\ub294 \ud754\ud558\uc9c0 \uc54a\uc740 \ubd80\ubd84\uc774\uae30\uc5d0 \uc774 \ucc45\uc774 \uc815\ub9d0 `\uc12c\uc138\ud558\ub2e4`\ub294 \ub290\ub08c\uc744 \ubc1b\uc558\uc2b5\ub2c8\ub2e4. \uac00\ub054 \uc77c\ubd80 \ubc88\uc5ed\uc11c\uc5d0\uc11c\ub294 \uc6a9\uc5b4\ub4e4\uc744 \uc804\ubd80 \ubc88\uc5ed\ub418\uace0 \uc601\ubb38\uc73c\ub85c \ud45c\uae30\uac00 \uc548 \ub418\uc5b4 \uc788\ub294 \ubd80\ubd84\ub4e4\uc774 \uc788\ub294\ub370 \uadf8\ub7f4 \ub54c\ub9c8\ub2e4 \ubd88\ud3b8\ud568\uc744 \ub290\ub08d\ub2c8\ub2e4. \uadf8\uc5d0 \ube44\ud574 \uad6d\ub0b4 \ub3c4\uc11c\uc778 \uc774 \ucc45\uc740 \ub3c5\uc790\ub97c \uc2e0\uacbd \uc4f0\ub294 \ub4ef\ud55c \ub290\ub08c\uc744 \uc8fc\uc5c8\uace0, \ub9e4\uc6b0 \uce5c\uc808\ud558\ub2e4\uace0 \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4.\\n\\n\uc194\uc9c1\ud788 \uc81c\uac00 \uc77d\uc740 \uba87\uba87 \ubc88\uc5ed\uc11c\uc5d0\uc11c\ub294 \uc601\uc5b4 \uc6d0\ubb38 \uadf8\ub300\ub85c\ub97c \uc54c\uace0 \uc2f6\uc740\ub370 \ucc98\uc74c \ub4e4\uc5b4\ubcf8 \uc6a9\uc5b4\ub4e4\ub85c \ubc88\uc5ed\ub41c \uacbd\uc6b0\ub4e4\uc774 \uaf64 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \uacbd\uc6b0\uc5d0\ub294 \uaf2d \uad6c\uae00\ub9c1\uc744 \ud574\ubcf4\uba74\uc11c \uadf8 \uc6a9\uc5b4\ub97c \ucc3e\uc558\uc5b4\uc57c \ud588\uc8e0. \ucc45\uc744 \uc77d\ub294 \uc0ac\ub78c\uc5d0\uc11c\ub294 \ubd88\ud3b8\ud55c \ubd80\ubd84\uc785\ub2c8\ub2e4. \ucc45\uc740 \uc790\uc2e0\uc774 \ubc30\uc6b0\uace0 \uc2f6\uc740 \ub0b4\uc6a9\uc744 \uc815\ub9ac\ud574\uc11c \ubcf4\uace0 \uc2f6\uc740 \uac83\uc778\ub370 \uadf8\uac78 \ub2e4\uc2dc \ucc3e\uc544\ubd10\uc57c \ud55c\ub2e4\ub2c8, \uadf8\uac83\ub9cc\ud07c \ubd88\ud3b8\ud55c \uac83\uc740 \uc5c6\uaca0\uc8e0. \ubb3c\ub860 \ucd5c\uadfc\uc5d0 \ub098\uc628 \ubc88\uc5ed\uc11c\ub4e4\uc740 \uc12c\uc138\ud574\uc11c \uc774\ub7f0 \ucc45\ub4e4\uc740 \ud754\ud558\uc9c0 \uc54a\uc744 \uac83\uc774\ub77c \uc0dd\uac01\ud569\ub2c8\ub2e4. \\n\\n\\n## \ub300\uc0c1\ub3c5\uc790\\n\\n\uc804 [Pro Git](https://git-scm.com/book/ko/v2)\uc73c\ub85c Git\uc744 \uacf5\ubd80\ud55c \uc0ac\ub78c\uc785\ub2c8\ub2e4. GitHub\ub294 \ub530\ub85c \uc778\ud130\ub137\uc5d0\uc11c \ubb38\uc11c\ub4e4\uc744 \ub9c9 \ucc3e\uc544\uac00\uba74\uc11c \uacf5\ubd80\ud588\uc5c8\uace0\uc694. \uc608\uc804\uc5d0 \uadf8 \ucc45\uc73c\ub85c Git\uc744 \uacf5\ubd80\ud558\uba74\uc11c \ub450 \ubc88 \uc815\ub3c4\ub294 \ud3ec\uae30\ud588\ub358 \uacbd\ud5d8\uc774 \uc788\uc2b5\ub2c8\ub2e4. tracked, staged \ub4f1 \uad00\uacc4\ub97c \uc774\ud574\ud558\ub294 \ub370 \uba38\ub9ac\uac00 \uc544\ud320\uac70\ub4e0\uc694. \uc774 \ucc45\uc740 \uadf8\ub7f0 \uac71\uc815 \ud544\uc694 \uc5c6\uc774 \uae54\ub054\ud558\uac8c \uc815\ub9ac\ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \ub610\ud55c, \ub3c5\uc790\ub97c \ubc30\ub824\ud558\ub294 \uc138\uc138\ud55c \ubd80\ubd84\ub4e4\uc774 \ub9ce\uc2b5\ub2c8\ub2e4. \ub2f9\uc7a5 \ud3b8\uc9d1\uc790\uc774\uc2e0 [\ucd5c\ud604\uc6b0 \ud3b8\uc9d1\uc790\ub2d8\uc758 \ud3b8\uc9d1 \ud6c4\uae30](https://brunch.co.kr/@hwchoi/32)\ub9cc \ubcf4\uc154\ub3c4 \uc54c \uc218 \uc788\uc744 \uac83\uc785\ub2c8\ub2e4. \uc81c\uac00 \ub9ac\ubdf0\ub97c \ud558\uba74\uc11c \uc801\uc5b4\ub454 \ubd80\ubd84 \uc774\uc678\uc5d0\ub3c4 \ub3c5\uc790\ub97c \uc0dd\uac01\ud558\uc2dc\ub294 \ubd80\ubd84\ub4e4\uc774 \ub354 \ub9ce\uc2b5\ub2c8\ub2e4. \uc815\ub9d0 \ub3c5\uc790\ub97c \uc704\ud558\uace0 \uae54\ub054\ud558\uac8c \uc815\ub9ac\ub41c \uc788\ub294 \ucc45\uc744 \ubcf4\uace0 \uc2f6\uc73c\uc2dc\ub2e4\uba74 \uc774 \ucc45\uc744 \ucd94\ucc9c\ud574 \ub4dc\ub9bd\ub2c8\ub2e4.\\n\\n\ucd5c\uadfc Git\uacfc GitHub\ub294 \uac1c\ubc1c\uc790\ub77c\uba74 \uac70\uc758 \ub204\uad6c\ub4e0\uc9c0 \uc54c\uc544\uc57c \ud558\ub294 \ud544\uc218 \uc9c0\uc2dd\uc774 \ub418\uc5b4\ubc84\ub838\uc2b5\ub2c8\ub2e4. \uae30\uc220\uc774 \ub610 \uc5b4\ub5bb\uac8c \ubc14\ub014\uc9c0\ub294 \uc798 \ubaa8\ub974\uaca0\uc9c0\ub9cc, GitHub\ub294 \uac1c\ubc1c\uc790\ub4e4\uc758 SNS \uac19\uc740 \ub290\ub08c\uc774\ub77c \uac1c\ubc1c\uc790\uc5d0\uac8c \uc720\uc6a9\ud55c \uc815\ubcf4\ub4e4\uc774 \ub9ce\uc774 \uc62c\ub77c\uc640 \uc788\uc2b5\ub2c8\ub2e4. Git\uacfc GitHub\ub294 \uc815\ub9d0 \uac1c\ubc1c\uc5d0 \uad00\uc2ec\uc774 \uc788\uc73c\uc2dc\ub2e4\uba74 \uc77c\ucc0d \ubc30\uc6b0\uba74 \ubc30\uc6b8\uc218\ub85d \ub3c4\uc6c0\uc774 \ub420 \uac83\uc785\ub2c8\ub2e4.\\n\\n\uc774 \ucc45\uc758 \uac00\uc7a5 \ud070 \uc7a5\uc810\uc740 \uc785\ubb38\uc11c\uc774\uba74\uc11c \ud604\uc5c5 \ud504\ub85c\uc138\uc2a4\ub97c \uacbd\ud5d8\ud574\ubcfc \uc218 \uc788\ub2e4\ub294 \uc810\uc785\ub2c8\ub2e4. \uae43\ub3c4 \uc2ec\ud654\uc801\uc778 \ubd80\ubd84\uc73c\ub85c \ub4e4\uc5b4\uac00\uba74 [submodule](https://git-scm.com/book/ko/v2/Git-%EB%8F%84%EA%B5%AC-%EC%84%9C%EB%B8%8C%EB%AA%A8%EB%93%88) \ub4f1\uc758 \ub0b4\uc6a9\uc774 \uc788\uc9c0\ub9cc \uadf8\ub7f0 \ub0b4\uc6a9\uc740 \uc81c\uc678\ud558\uace0 \uc815\ub9d0 \ud604\uc5c5\uc5d0\uc11c \uc790\uc8fc \uc4f0\uc774\ub294 \ub0b4\uc6a9\uc774 \ub2f4\uaca8 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \uc804 \uc774 \ucc45\uc744 Git\uacfc GitHub\uc5d0 \uc775\uc219\ud558\uc9c0 \uc54a\uc740 \uc785\ubb38\uc790\uc5d0\uac8c \ucd94\ucc9c\ud558\uace0 \uc2f6\uc2b5\ub2c8\ub2e4."},{"id":"/review/some-death-told-life","metadata":{"permalink":"/blog/review/some-death-told-life","editUrl":"https://github.com/teddygood/teddygood.github.io/blog/review/some-death-told-life.md","source":"@site/blog/review/some-death-told-life.md","title":"\uc5b4\ub5a4 \uc8fd\uc74c\uc774 \uc0b6\uc5d0\uac8c \ub9d0\ud588\ub2e4","description":"\uc0dd\uc758 \ub0a8\uc740 \uc2dc\uac04\uc774 \uc6b0\ub9ac\uc5d0\uac8c \ub4e4\ub824\uc8fc\ub294 \uac83","date":"2021-04-18T00:00:00.000Z","formattedDate":"2021\ub144 4\uc6d4 18\uc77c","tags":[{"label":"Book Review","permalink":"/blog/tags/book-review"}],"hasTruncateMarker":false,"authors":[{"name":"Chanho Lee","title":"\ub2e4\uc591\ud55c \ubd84\uc57c\ub97c \uacf5\ubd80\ud558\ub294 \uac83\uc774 \uc88b\uc740 \ud559\uc0dd","url":"https://github.com/teddygood","imageURL":"https://github.com/teddygood.png","key":"teddygood"}],"frontMatter":{"title":"\uc5b4\ub5a4 \uc8fd\uc74c\uc774 \uc0b6\uc5d0\uac8c \ub9d0\ud588\ub2e4","date":"2021-04-18","authors":"teddygood","tags":["Book Review"],"draft":false,"description":"\uc0dd\uc758 \ub0a8\uc740 \uc2dc\uac04\uc774 \uc6b0\ub9ac\uc5d0\uac8c \ub4e4\ub824\uc8fc\ub294 \uac83","keywords":["\uc8fd\uc74c","\uc0b6","\uc554","\uc11c\uc6b8\ub300\ubcd1\uc6d0 \uc885\uc591\ub0b4\uacfc"],"sidebar_position":1},"prevItem":{"title":"\ubc15\ubbf8\uc815\uc758 \uae43&\uae43\ud5c8\ube0c \uc785\ubb38","permalink":"/blog/review/Git-GitHub-introduction"}},"content":"## Book Info\\n\\n**<center>`\ucc45 \uc774\ubbf8\uc9c0\ub97c \ud074\ub9ad\ud558\uba74 \uad50\ubcf4\ubb38\uace0 \uc0ac\uc774\ud2b8\ub85c \uc774\ub3d9\ud569\ub2c8\ub2e4!`</center>**\\n\\n[![\ucc45](../assets/review/some-death-told-life.jpg)](https://www.kyobobook.co.kr/product/detailViewKor.laf?ejkGb=KOR&mallGb=KOR&barcode=9788965964230&orderClick=LEa&Kc=)\\n\\n- \uc81c\ubaa9: \uc5b4\ub5a4 \uc8fd\uc74c\uc774 \uc0b6\uc5d0\uac8c \ub9d0\ud588\ub2e4\\n- \uc800\uc790: \uae40\ubc94\uc11d\\n- \ucd9c\ud310\uc0ac: \ud750\ub984\ucd9c\ud310\\n- \ucd9c\uac04: 2021-01-18\\n\\n## Intro\\n\\n\uc0ac\uc2e4 \uc774 \ucc45\uc740 \ub3c4\uc11c\uad00\uc5d0\uc11c \ube4c\ub9b0 \ucc45\ub3c4 \uc544\ub2c8\uba70, \uc81c\uac00 \uc9c1\uc811 \uc0b0 \ucc45\ub3c4 \uc544\ub2d9\ub2c8\ub2e4. \uc774 \uae00\uc744 \uc77d\uace0 \uc788\uc73c\uc2e0 \ubd84\uc774 \ub9cc\uc57d \uc0bc\uc131 \ud3f0\uc744 \uc4f0\uc2e0\ub2e4\uba74 \uc9c0\uae08 \uae00\uc744 \uc4f0\ub294 4\uc6d4 30\uc77c\uae4c\uc9c0\ub294 \ub2e4\uc6b4\ub85c\ub4dc\ud574 \ubcfc \uc218 \uc788\uc2b5\ub2c8\ub2e4. `\uad50\ubcf4eBook for SAMSUNG`\uc5b4\ud50c\uc740 \ub9e4\ub2ec \uc88b\uc740 \ucc45 \ud55c \uad8c\uc744 \uc77d\uc744 \uc218 \uc788\ub3c4\ub85d \uc81c\uacf5\ud574\uc90d\ub2c8\ub2e4. \ub0b4\uc77c\uc774\uba74 \ub610 \uc0c8\ub85c\uc6b4 \ucc45\uc744 \ubb34\ub8cc\ub85c \uc77d\uc744 \uc218 \uc788\uaca0\ub124\uc694. \ud55c \uad8c\ubfd0\uc774\uc9c0\ub9cc \uc0c1\ub2f9\ud788 \uc88b\uc740 \uc11c\ube44\uc2a4\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc81c\uac00 \uc0dd\uac01\uc9c0\ub3c4 \ubabb\ud55c \ucc45\ub4e4\uc744 \uc77d\uc5b4\ubcf4\ub77c\uace0 \uc81c\uacf5\ud574\uc8fc\ub2c8\uae4c\uc694.\\n\\n\uc804 `\uc774 \ucc45\uc744 \uc77d\uc744\uae4c? \ub9d0\uae4c?`\ub77c\ub294 \uace0\ubbfc\uc744 \ud588\uc5c8\uc2b5\ub2c8\ub2e4. \uc800\uc5d0\uac8c \uc8fd\uc74c\uc774\ub780 \ub2e4\uc18c \ubb34\uac70\uc6b4 \uc8fc\uc81c\uac00 \uc544\ub2cc\uac00 \uc0dd\uac01\uc774 \ub4e4\uc5c8\uac70\ub4e0\uc694. \uadfc\ub370 \ucd5c\uadfc \uc720\ud29c\ube0c\uc5d0\uc11c \ud55c \uc601\uc0c1\uc744 \ubcf4\uace0 \uc774 \ucc45\uc744 \uc77d\uc5b4\ubcf4\uace0 \uc2f6\uac8c \ub410\uc2b5\ub2c8\ub2e4.\\n\\n{% youtube fkI01YUU6To %}\\n\\n\ucd5c\uadfc `\uc720\ud034\uc988`\ub77c\ub294 \ud504\ub85c\uadf8\ub7a8\uc744 \uc720\ud29c\ube0c\ub85c \uc790\uc8fc \ubd05\ub2c8\ub2e4. \uc5b4\ub290 \ub0a0 \uc720\ud29c\ube0c \uc54c\uace0\ub9ac\uc998\uc774 \uc704\uc758 \uc601\uc0c1\uc744 \ucd94\ucc9c\ud574\uc11c \ubcf4\uac8c \ub410\uc2b5\ub2c8\ub2e4. \uc774 \ucc45\uc758 \uc800\uc790\uac00 \uc774 \uc601\uc0c1\uc5d0 \ub098\uc624\ub294\ub370 \uc2e4\ubb3c\uc744 \ubaa8\ub974\ub2c8\uae4c \ucc98\uc74c\uc5d0\ub294 \'\ub204\uad6c\uc9c0? \ub204\uad6c\uc9c0? \uc5b4\ub514\uc11c \ub4e4\uc5b4\ubcf8 \uc0ac\ub78c \uac19\uc740\ub370...\' \uacc4\uc18d \uc0dd\uac01\ud558\ub2e4\uac00 \uc774 \ucc45\uc758 \uc800\uc790\uc778 \uac83\uc744 \uc54c\uac8c \ub418\uace0 \uc774 \ucc45\uc744 \uc77d\uae30\ub85c \uacb0\uc2ec\ud588\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n## \ucc45 \uc18c\uac1c\\n\\n\uc774 \ucc45\uc740 \ud06c\uac8c 4\ubd80\ub85c \ub098\ub204\uc5b4\uc838 \uc788\uc2b5\ub2c8\ub2e4. 1\ubd80\ub294 \uc608\uc815\ub41c \uc8fd\uc74c \uc55e\uc5d0\uc11c \ub9cc\ub09c \uc0ac\ub78c\ub4e4\uc758 \uc774\uc57c\uae30, 2\ubd80\ub294 \uc554\uc5d0 \uac78\ub838\uc5b4\ub3c4 \uadf8\ub7fc\uc5d0\ub3c4 \uc0b4\uc544\uac00\ub294 \uc0ac\ub78c\ub4e4\uc758 \uc774\uc57c\uae30, 3\ubd80\uc640 4\ubd80\ub294 \uc0dd\uc0ac\uc758 \uacbd\uacc4\uc5d0\uc11c\uc758 \uc774\uc57c\uae30\uc785\ub2c8\ub2e4.\\n\\n\uc800\uc790\ub294 `\uc11c\uc6b8\ub300\ubcd1\uc6d0 \uc885\uc591\ub0b4\uacfc \uc804\ubb38\uc758`\ub77c\ub294 \uc9c1\uc5c5\uc744 \uac16\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \ub204\uad6c\ubcf4\ub2e4\ub3c4 \uc554\uc73c\ub85c \ub3cc\uc544\uac00\uc2dc\ub294 \ud658\uc790\ubd84\ub4e4\uc758 \uc8fd\uc74c\uc744 \uac00\uae4c\uc774\uc11c \ubcf8 \ubd84\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \uc774 \ucc45\uc740 \uadf8\ub7f0 \uc758\uc0ac\uac00 \ud658\uc790\ub97c \uce58\ub8cc\ud558\uba74\uc11c \uacbd\ud5d8\ud558\uace0, \ub290\ub080 \uac83\ub4e4\uc774 \uae30\ub85d\ub41c \ucc45\uc785\ub2c8\ub2e4. \uc0b6\uc758 \ub05d\uc744 \uba3c\uc800 \ub9de\uc774\ud55c \uc0ac\ub78c\ub4e4\uc744 \uc9c0\ucf1c\ubcf4\uba70 \ub9ce\uc740 \uc9c8\ubb38\uc744 \uc2a4\uc2a4\ub85c \ub358\uc9c0\uba74\uc11c \uc0dd\uac01\ud558\ub294 \ubaa8\uc2b5\ub4e4\uc744 \ubcf4\uc5ec\uc90d\ub2c8\ub2e4.\\n\\n## \uac10\uc0c1\\n\\n\uc774 \ucc45\uc744 \uc77d\uc73c\ub824\uace0 \ud588\uc744 \ub54c\ub294 \uadfc\ucc98\uc5d0 \uc554 \ud658\uc790\uac00 \uc5c6\uc5b4\uc11c \ud06c\uac8c \uacf5\uac10\ud558\uc9c0 \ubabb \ud560 \uc904 \uc54c\uc558\ub294\ub370 \ucc45\uc744 \uc77d\uc73c\uba74\uc11c \uc0dd\uac01\uc774 \ubc14\ub00c\uc5c8\uc2b5\ub2c8\ub2e4. \uc774 \ucc45\uc5d0\uc11c \ub4e4\ub824\uc8fc\ub294 \uc774\uc57c\uae30\ub4e4\uc740 \uc554 \ud658\uc790\ub4e4\uc758 \uc774\uc57c\uae30\uc9c0\ub9cc, \uc554\uc774 \uc911\uc2ec\uc774 \uc544\ub2d9\ub2c8\ub2e4. \uc554\uc774 \uc544\ub2c8\ub77c \uc8fd\uc74c\uc774 \uc911\uc2ec\uc785\ub2c8\ub2e4. \uc8fd\uc74c\uc774 \ub2e4\uac00\uc62c \ub54c \uc0ac\ub78c\ub4e4\uc758 \ubaa8\uc2b5\ub4e4, \uc758\uc0ac\ub85c\uc11c \uc8fd\uc74c\uc5d0 \ub300\ud55c \uc0dd\uac01\ub4e4 \ub4f1\uc774 \uc911\uc810\uc774\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4.\\n\\n\uc804 \uc774 \ucc45\uc774 \uaf64 \ubb34\uac81\ub2e4\uace0 \uc0dd\uac01\uc774 \ub4e4\uc5b4 \uc77d\ub294 \ub370 \uc624\ub79c \uae30\uac04\uc774 \uac78\ub838\uc2b5\ub2c8\ub2e4. \uc5d0\uc138\uc774 \ud615\uc2dd\uc774\ub77c \ud55c \uc18c\ub2e8\uc6d0 \uc989, \ud55c \uc774\uc57c\uae30\uc529 \uc77d\uc73c\uba74 \ub418\uc5b4\uc11c \ucd5c\ub300\ud55c \uae30\uac04\uc744 \ub450\uace0 \uc77d\uc73c\ub824\uace0 \ud588\uc2b5\ub2c8\ub2e4. \uac1c\uc778\uc801\uc73c\ub85c \ucc45\uc744 \uc77d\uc5c8\uc744 \ub54c \ud55c \ubc88\uc5d0 \uc804\ubd80 \uc77d\ub294 \uac83\uc744 \uc88b\uc544\ud558\uc9c0\ub9cc, \uc774 \ucc45\uc740 \ub3c4\uc800\ud788 \uadf8\ub807\uac8c \uc77d\uc744 \uc218 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \uc704\uc5d0\uc11c \ub9d0\ud588\ub4ef\uc774 \ud55c \uc774\uc57c\uae30\ub97c \uc77d\uc73c\uba74\uc11c \uc81c \uc0dd\uac01\ub3c4 \uacf1\uc539\uc5b4\ubcf4\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub807\uae30\uc5d0 \ub354 \ucc9c\ucc9c\ud788 \uc77d\uace0 \uc2f6\uc5c8\uc2b5\ub2c8\ub2e4.\\n\\n\uc5d0\uc138\uc774\ub77c\ub294 \uc7a5\ub974\ub294 \ub300\uac1c \uacf5\uac10\uc774 \uc548 \ub418\ub294 \ub0b4\uc6a9\ub3c4 \ub9ce\uc558\uc5c8\ub294\ub370 \uc774 \ucc45\uc740 \ub9ce\uc774 \ub2ec\ub790\uc2b5\ub2c8\ub2e4. \uc81c\uac00 \ub9c8\uce58 \uc11c\uc6b8\ub300\ubcd1\uc6d0 \uc885\uc591\ub0b4\uacfc \uc804\ubb38\uc758\uac00 \ub41c \uac83\ucc98\ub7fc \ub290\uaf08\uc2b5\ub2c8\ub2e4. \ud3c9\ubc94\ud55c \ub300\ud559\uc0dd\uc73c\ub85c\uc11c \uc774 \ucc45\uc758 \uc800\uc790\uc758 \uacbd\ud5d8\uc774 \uc18c\uc911\ud558\uac8c \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \uacbd\ud5d8\ub4e4\uacfc \uc0dd\uac01\ub4e4\uc740 \ucc45\uc774 \uc5c6\uc5c8\ub354\ub77c\uba74 \uc54c\uc9c0 \ubabb\ud588\uc5c8\uc744 \uac70\ub77c\uace0 \uc0dd\uac01\ud569\ub2c8\ub2e4. \\n\\n## \ub9c8\uc9c0\ub9c9 \\n\\n\uc815\ub9d0 \ub9ce\uc740 \uc0dd\uac01\ub4e4\uc774 \ub0a8\uac8c \ub418\ub294 \ucc45\uc785\ub2c8\ub2e4. \uc81c \uc0dd\uac01\ub4e4\ub3c4 \ub9ce\uc774 \ub0a8\uae30\uace0 \uc2f6\uc9c0\ub9cc, \ub108\ubb34 \ub9ce\uae30\ub3c4 \ud558\uace0 \ub108\ubb34\ub098\ub3c4 \uac1c\uc778\uc801\uc778 \uc0dd\uac01\ub4e4\uc774\ub77c \ub0a8\uae30\uc9c0 \ubabb\ud558\uaca0\uc2b5\ub2c8\ub2e4. \uc774 \ucc45\uc744 \uc77d\uc5b4\ubcfc\uae4c \uace0\ubbfc\uc774 \ub418\uc2e0\ub2e4\uba74 \uace0\ubbfc\ud560 \ud544\uc694\uac00 \uc5c6\ub2e4\uace0 \ub9d0\uc500\ub4dc\ub9ac\uace0 \uc2f6\uc2b5\ub2c8\ub2e4. \uc77d\uc5b4\ubcf4\uc138\uc694. \uadf8\ub9ac\uace0 \uc0dd\uac01\ud574 \ubd10\uc694."}]}')}}]);